	(4, 'pb_project', '2019-11-29 16:22:15', '2020-01-30 15:15:04', 'A greener city ', 2, 3, '<pb_project>\r\n<document-id>4</document-id>\r\n<document-title><![CDATA[A greener city ]]></document-title>\r\n<document-summary><![CDATA[A greener city ]]></document-summary>\r\n<document-date-begin>29/11/2019</document-date-begin>\r\n<document-date-end></document-date-end>\r\n<document-skip-portlet>false</document-skip-portlet>\r\n<document-skip-categories>false</document-skip-categories>\r\n<document-categories></document-categories>\r\n<pb_project-proposal_subtitle>A greener city </pb_project-proposal_subtitle>\r\n<pb_project-theme>ENVIRONMENT</pb_project-theme>\r\n<pb_project-description><![CDATA[<p>Chaque ann&eacute;e, &agrave; l&rsquo;occasion du vote du budget participatif, les Parisiennes et les Parisiens pl&eacute;biscitent les projets relatifs &agrave; la propret&eacute; et au recyclage t&eacute;moignant ainsi un grand int&eacute;r&ecirc;t pour la qualit&eacute; et le respect de leur espace public et leur attention pour l&rsquo;&eacute;conomie circulaire. Ce projet veut rassembler plusieurs initiatives qui souhaitent poursuivre et renforcer les investissements municipaux dans les &eacute;quipements, le mat&eacute;riel des agents, le mobilier urbain et les dispositifs d&rsquo;information li&eacute;s &agrave; la propret&eacute;.</p>\r\n<p>Il propose de :</p>\r\n<p>- mettre en place davantage de sanitaires (sanisettes, urinoirs, uri-trottoirs&hellip;) et les r&eacute;f&eacute;rencer via une application smartphone ;<br />- renforcer l&rsquo;acquisition de v&eacute;hicules et de mat&eacute;riel innovants, &eacute;cologiques et &agrave; faible impact sonore pour les agents de la propret&eacute; ;<br />- installer du mobilier de propret&eacute; innovant (miroirs contre les urines par exemple) ;<br />- d&eacute;velopper le nombre d&rsquo;&eacute;quipements de tri sur l&rsquo;ensemble du territoire parisien (dans les immeubles et sur l&rsquo;espace public) et de les signaler efficacement pour informer le public ;<br />- mettre en place des dispositifs de type &laquo; nudge &raquo;, tels que des marquages d&rsquo;empreintes de pieds au sol ou des cendriers p&eacute;dagogiques pour amener les usagers &agrave; modifier leur comportement.</p>]]></pb_project-description>\r\n<pb_project-location>area_1</pb_project-location>\r\n<pb_project-address></pb_project-address>\r\n<pb_project-proposal_url><![CDATA[http://]]></pb_project-proposal_url>\r\n<pb_project-value>500000</pb_project-value>\r\n<pb_project-department></pb_project-department>\r\n<pb_project-image><![CDATA[<img src="https://cdn.paris.fr/paris/2019/07/24/huge-9922946df32a8755a8f611c71efd56ca.jpg"/>]]></pb_project-image>\r\n<pb_project-total_votes></pb_project-total_votes>\r\n<pb_project-status>SOUMIS</pb_project-status>\r\n<pb_project-content><![CDATA[]]></pb_project-content>\r\n<pb_project-address_geoloc></pb_project-address_geoloc>\r\n<pb_project-phase1_start_date></pb_project-phase1_start_date>\r\n<pb_project-phase2_start_date></pb_project-phase2_start_date>\r\n<pb_project-phase3_start_date></pb_project-phase3_start_date>\r\n<pb_project-phase4_start_date></pb_project-phase4_start_date>\r\n<pb_project-phase4_end_date></pb_project-phase4_end_date>\r\n<pb_project-campaign>A</pb_project-campaign>\r\n<pb_project-proposal_id></pb_project-proposal_id>\r\n<pb_project-proposal_nicknames></pb_project-proposal_nicknames>\r\n<pb_project-proposal_title></pb_project-proposal_title>\r\n<pb_project-step1_start_date></pb_project-step1_start_date>\r\n<pb_project-step2_start_date></pb_project-step2_start_date>\r\n<pb_project-step3_start_date></pb_project-step3_start_date>\r\n<pb_project-step4_start_date></pb_project-step4_start_date>\r\n<pb_project-step5_start_date></pb_project-step5_start_date>\r\n<pb_project-popular_area>no</pb_project-popular_area>\r\n</pb_project>\r\n', '<pb_project>\r\n<document-id>4</document-id>\r\n<document-title><![CDATA[A greener city ]]></document-title>\r\n<document-su