	(5, 'pb_project', '2019-11-29 16:24:01', '2020-01-30 15:15:00', 'Circular economy', 2, 3, '<pb_project>\r\n<document-id>5</document-id>\r\n<document-title><![CDATA[Circular economy]]></document-title>\r\n<document-summary><![CDATA[Circular economy]]></document-summary>\r\n<document-date-begin>29/11/2019</document-date-begin>\r\n<document-date-end></document-date-end>\r\n<document-skip-portlet>false</document-skip-portlet>\r\n<document-skip-categories>false</document-skip-categories>\r\n<document-categories></document-categories>\r\n<pb_project-proposal_subtitle>Circular economy</pb_project-proposal_subtitle>\r\n<pb_project-theme>SOCIAL</pb_project-theme>\r\n<pb_project-description><![CDATA[<p>Notre production de d&eacute;chets a doubl&eacute; en quarante ans ! Ces d&eacute;chets co&ucirc;tent cher, et leur impact environnemental est souvent nuisible. Il est paradoxal, de surcro&icirc;t, de jeter autant, alors que certains manquent de tout&hellip; Un autre mod&egrave;le est possible : la r&eacute;cup&eacute;ration, pour donner une nouvelle vie &agrave; ce qui n&rsquo;est pas toujours in&eacute;luctablement un d&eacute;chet ; qu&rsquo;il s&rsquo;agisse d&rsquo;objets ou d&rsquo;alimentation, passons du gaspillage au partage !<br />- avec des ressourceries de quartier, o&ugrave; chacun peut apporter ce qui encombre ses placards, et chiner &agrave; bon prix ce qui est d&eacute;laiss&eacute; par d&rsquo;autres. Ces ressourceries cr&eacute;ent des emplois, du lien social. Elles sont aussi, souvent, corr&eacute;l&eacute;es &agrave; des caf&eacute;s qui r&eacute;cup&egrave;rent des fruits et l&eacute;gumes moches, des denr&eacute;es en date limite de consommation, pour proposer de bons repas accessibles &agrave; tous. Ces lieux d&rsquo;animation permettent aussi d&rsquo;apprendre les gestes du quotidien pour r&eacute;parer et remettre en service ce que d&rsquo;aucuns croient inutilisable, et qui pourtant ne m&eacute;rite pas la poubelle.<br />- avec des solutions applicatives pour mutualiser les objets, ou encore pour favoriser le r&eacute;emploi des mat&eacute;riaux dans la construction et la r&eacute;novation des b&acirc;timents.<br />- avec des bo&icirc;tes &agrave; dons d&rsquo;hyper proximit&eacute;, et des animations micro-locales, pour s&rsquo;&eacute;changer des objets, des denr&eacute;es, cultiver l&rsquo;esprit du don et du partage.</p>]]></pb_project-description>\r\n<pb_project-location>area_1</pb_project-location>\r\n<pb_project-address></pb_project-address>\r\n<pb_project-proposal_url><![CDATA[http://]]></pb_project-proposal_url>\r\n<pb_project-value>3500000</pb_project-value>\r\n<pb_project-department></pb_project-department>\r\n<pb_project-image><![CDATA[<img src="https://cdn.paris.fr/paris/2019/09/16/huge-804e5cfb27091437b87aa2aeea02e40c.jpg">]]></pb_project-image>\r\n<pb_project-total_votes></pb_project-total_votes>\r\n<pb_project-status>SOUMIS</pb_project-status>\r\n<pb_project-content><![CDATA[]]></pb_project-content>\r\n<pb_project-address_geoloc></pb_project-address_geoloc>\r\n<pb_project-phase1_start_date></pb_project-phase1_start_date>\r\n<pb_project-phase2_start_date></pb_project-phase2_start_date>\r\n<pb_project-phase3_start_date></pb_project-phase3_start_date>\r\n<pb_project-phase4_start_date></pb_project-phase4_start_date>\r\n<pb_project-phase4_end_date></pb_project-phase4_end_date>\r\n<pb_project-campaign>A</pb_project-campaign>\r\n<pb_project-proposal_id></pb_project-proposal_id>\r\n<pb_project-proposal_nicknames></pb_project-proposal_nicknames>\r\n<pb_project-proposal_title></pb_project-proposal_title>\r\n<pb_project-step1_start_date></pb_project-step1_start_date>\r\n<pb_project-step2_start_date></pb_project-step2_start_date>\r\n<pb_project-step3_start_date></pb_project-step3_start_date>\r\n<pb_project-step4_start_date></pb_project-step4_start_date>\r\n<pb_project-step5_start_date></pb_project-step5_start_date>\r\n<pb_project-popular_area>Popular location</pb_project-popular_area>\r\n</pb_project>\r\n', '<pb_project>\r\n<document-id>5</document-id>\r\n<document-title><![CDATA[Circular economy]]></document-title>\r\n<document-summary><![CDATA[Circular economy]]></document-summary>\r\n<document-date-begin>29/11/2019</document-date-begin>\r\n<document-date-end></document-date-end>\r\n<document-skip-portlet>false</document-skip-portlet>\r\n<document-skip-categories>false</document-skip-categories>\r\n<document-categories></document-categories>\r\n<pb_project-proposal_subtitle>Circular economy</pb_project-proposal_subtitle>\r\n<pb_project-theme>SOCIAL</pb_project-theme>\r\n<pb_project-description><![CDATA[<p>Notre production de d&eacute;chets a doubl&eacute; en quarante ans ! Ces d&eacute;chets co&ucirc;tent cher, et leur impact environnemental est souvent nuisible. Il est paradoxal, de surcro&icirc;t, de jeter autant, alors que certains manquent de tout&hellip; Un autre mod&egrave;le est possible : la r&eacute;cup&eacute;ration, pour donner une nouvelle vie &agrave; ce qui n&rsquo;est pas toujours in&eacute;luctablement un d&eacute;chet ; qu&rsquo;il s&rsquo;agisse d&rsquo;objets ou d&rsquo;alimentation, passons du gaspillage au partage !<br />- avec des ressourceries de quartier, o&ugrave; chacun peut apporter ce qui encombre ses placards, et chiner &agrave; bon prix ce qui est d&eacute;laiss&eacute; par d&rsquo;autres. Ces ressourceries cr&eacute;ent des emplois, du lien social. Elles sont aussi, souvent, corr&eacute;l&eacute;es &agrave; des caf&eacute;s qui r&eacute;cup&egrave;rent des fruits et l&eacute;gumes moches, des denr&eacute;es en date limite de consommation, pour proposer de bons repas accessibles &agrave; tous. Ces lieux d&rsquo;animation permettent aussi d&rsquo;apprendre les gestes du quotidien pour r&eacute;parer et remettre en service ce que d&rsquo;aucuns croient inutilisable, et qui pourtant ne m&eacute;rite pas la poubelle.<br />- avec des solutions applicatives pour mutualiser les objets, ou encore pour favoriser le r&eacute;emploi des mat&eacute;riaux dans la construction et la r&eacute;novation des b&acirc;timents.<br />- avec des bo&icirc;tes &agrave; dons d&rsquo;hyper proximit&eacute;, et des animations micro-locales, pour s&rsquo;&eacute;changer des objets, des denr&eacute;es, cultiver l&rsquo;esprit du don et du partage.</p>]]></pb_project-description>\r\n<pb_project-location>area_1</pb_project-location>\r\n<pb_project-address></pb_project-address>\r\n<pb_project-proposal_url><![CDATA[http://]]></pb_project-proposal_url>\r\n<pb_project-value>3500000</pb_project-value>\r\n<pb_project-department></pb_project-department>\r\n<pb_project-image><![CDATA[<img src="https://cdn.paris.fr/paris/2019/09/16/huge-804e5cfb27091437b87aa2aeea02e40c.jpg">]]></pb_project-image>\r\n<pb_project-total_votes></pb_project-total_votes>\r\n<pb_project-status>SOUMIS</pb_project-status>\r\n<pb_project-content><![CDATA[]]></pb_project-content>\r\n<pb_project-address_geoloc></pb_project-address_geoloc>\r\n<pb_project-phase1_start_date></pb_project-phase1_start_date>\r\n<pb_project-phase2_start_date></pb_project-phase2_start_date>\r\n<pb_project-phase3_start_date></pb_project-phase3_start_date>\r\n<pb_project-phase4_start_date></pb_project-phase4_start_date>\r\n<pb_project-phase4_end_date></pb_project-phase4_end_date>\r\n<pb_project-campaign>A</pb_project-campaign>\r\n<pb_project-proposal_id></pb_project-proposal_id>\r\n<pb_project-proposal_nicknames></pb_project-proposal_nicknames>\r\n<pb_project-proposal_title></pb_project-proposal_title>\r\n<pb_project-step1_start_date></pb_project-step1_start_date>\r\n<pb_project-step2_start_date></pb_project-step2_start_date>\r\n<pb_project-step3_start_date></pb_project-step3_start_date>\r\n<pb_project-step4_start_date></pb_project-step4_start_date>\r\n<pb_project-step5_start_date></pb_project-step5_start_date>\r\n<pb_project-popular_area>Popular location</pb_project-popular_area>\r\n</pb_project>\r\n', 'Circular economy', '', '2019-11-29 00:00:00', NULL, NULL, 1, 0, 1, 0, 0),
	(6, 'pb_project', '2019-11-29 16:25:27', '2020-01-30 15:15:09', 'Urban sport', 2, 3, '<pb_project>\r\n<document-id>6</document-id>\r\n<document-title><![CDATA[Urban sport]]></document-title>\r\n<document-summary><![CDATA[Urban sport]]></document-summary>\r\n<document-date-begin>29/11/2019</document-date-begin>\r\n<document-date-end></document-date-end>\r\n<document-skip-portlet>false</document-skip-portlet>\r\n<document-skip-categories>false</document-skip-categories>\r\n<document-categories></document-categories>\r\n<pb_project-proposal_subtitle>Urban sport</pb_project-proposal_subtitle>\r\n<pb_project-theme>SPORT</pb_project-theme>\r\n<pb_project-description><![CDATA[<p>&nbsp;</p>\r\n<p>Agr&egrave;s pour pratiquer la gymnastique ou la musculation, cr&eacute;ation de terrains de jeux de ballons (Playground, City Stade)... : une autre fa&ccedil;on de vivre le sport en milieu urbain. Le tout sur des sites inhabituels, comme des terrains install&eacute;s sous les lignes de m&eacute;tro a&eacute;riennes ou sur la petite ceinture. A Paris, le sport se pratique aussi en dehors des stades. Le sport urbain gagne en effet chaque ann&eacute;e de nouveaux adeptes. Le projet pr&eacute;voit donc d\'accompagner cette tendance en proposant aux fanas des Street Games - en franglais, "jeux dans la rue" - de nouveaux lieux pour jouer en toute libert&eacute;. Pas de r&eacute;servation, une pratique entre amis, chacun &agrave; son rythme... : c\'est le secret de la r&eacute;ussite du sport urbain !<br />Le projet comprend deux composantes :<br />- D\'une part, l\'installation d\'agr&egrave;s et de parcours sportifs, afin de pratiquer la gymnastique et la musculation. Environ huit sites suppl&eacute;mentaires pourront &ecirc;tre &eacute;quip&eacute;s : esplanades, jardins publics ou certains points de la Petite Ceinture.<br />- D\'autre part, la cr&eacute;ation de terrains de jeux de ballons (Street Basket, foot &agrave; cinq...) sur des lieux insolites : espaces libres sous le m&eacute;tro a&eacute;rien ou sur la Petite Ceinture, r&eacute;utilisation du playground du Pavillon de l\'Arsenal (4e). Environ six lieux pourront ainsi &ecirc;tre &eacute;quip&eacute;s.<br />Cette nouvelle offre renforcera la liste - d&eacute;j&agrave; longue - des sports urbains pratiqu&eacute;s &agrave; Paris : roller, skate, boules, base nautique de la Villette... Sans oublier toutes les activit&eacute;s de Paris Plage et les plaines de jeux des bois de Boulogne et de Vincennes.<br />&nbsp;</p>\r\n<p>&nbsp;</p>]]></pb_project-description>\r\n<pb_project-location>area_2</pb_project-location>\r\n<pb_project-address></pb_project-address>\r\n<pb_project-proposal_url><![CDATA[http://]]></pb_project-proposal_url>\r\n<pb_project-value>2000000</pb_project-value>\r\n<pb_project-department></pb_project-department>\r\n<pb_project-image><![CDATA[]]></pb_project-image>\r\n<pb_project-total_votes></pb_project-total_votes>\r\n<pb_project-status>SOUMIS</pb_project-status>\r\n<pb_project-content><![CDATA[]]></pb_project-content>\r\n<pb_project-address_geoloc></pb_project-address_geoloc>\r\n<pb_project-phase1_start_date></pb_project-phase1_start_date>\r\n<pb_project-phase2_start_date></pb_project-phase2_start_date>\r\n<pb_project-phase3_start_date></pb_project-phase3_start_date>\r\n<pb_project-phase4_start_date></pb_project-phase4_start_date>\r\n<pb_project-phase4_end_date></pb_project-phase4_end_date>\r\n<pb_project-campaign>A</pb_project-campaign>\r\n<pb_project-proposal_id></pb_project-proposal_id>\r\n<pb_project-proposal_nicknames></pb_project-proposal_nicknames>\r\n<pb_project-proposal_title></pb_project-proposal_title>\r\n<pb_project-step1_start_date></pb_project-step1_start_date>\r\n<pb_project-step2_start_date></pb_project-step2_start_date>\r\n<pb_project-step3_start_date></pb_project-step3_start_date>\r\n<pb_project-step4_start_date></pb_project-step4_start_date>\r\n<pb_project-step5_start_date></pb_project-step5_start_date>\r\n<pb_project-popular_area>no</pb_project-popular_