	(7, 'pb_project', '2019-11-29 16:27:35', '2020-01-30 15:15:19', 'Wall of Peace', 2, 3, '<pb_project>\r\n<document-id>7</document-id>\r\n<document-title><![CDATA[Wall of Peace]]></document-title>\r\n<document-summary><![CDATA[Wall of Peace]]></document-summary>\r\n<document-date-begin>29/11/2019</document-date-begin>\r\n<document-date-end></document-date-end>\r\n<document-skip-portlet>false</document-skip-portlet>\r\n<document-skip-categories>false</document-skip-categories>\r\n<document-categories></document-categories>\r\n<pb_project-proposal_subtitle>Wall of Peace</pb_project-proposal_subtitle>\r\n<pb_project-theme>SOCIAL</pb_project-theme>\r\n<pb_project-description><![CDATA[<p>LE MUR DE LA PAIX est un projet sur le devoir de m&eacute;moire pour se souvenir des personnalit&eacute;s qui ont pr&ocirc;n&eacute; la NON-VIOLENCE et LA PAIX. Il s\'agit d\'embellir le mur de 180m&sup2; de superficie et de d&eacute;corer la cour d\'un coll&egrave;ge class&eacute; ZEP et qui est situ&eacute; dans la Cit&eacute; Michelet ZUS ET ZSP. Les portraits seront ceux de Socrate, Hatchepsout, Lao Tseu, Averoes, Galil&eacute;e, Moli&egrave;re, Olympe de Gouges, Victor Hugo, Jean Jaur&egrave;s, Aim&eacute; C&eacute;saire, Jacques Rabemananjara, Rosa Parks, Martin Luther King, M&egrave;re Th&eacute;resa, Gandhi, Charlie Chaplin, Yehudi Menuhin, Bob Marley, Coluche, Irena Sendlerowa, Nelson Mandela.<br />Des peintres graffiteurs de renom encadreront durant un trimestre &agrave; l\'heure du d&eacute;jeuner les jeunes coll&eacute;giens, pour qu\'ils peignent le portrait de personnalit&eacute;s ic&ocirc;nes du pacifisme et de la non-violence ayant jalonn&eacute; l\'histoire de l\'Humanit&eacute;.<br />Le nom d\'Edmond Michelet sera graffit&eacute; au centre de ce mur, en graffiti v&eacute;g&eacute;tal.<br />Un relais &laquo; information &raquo; mensuel sera organis&eacute; &agrave; la R&eacute;gie de quartier de la Cit&eacute; Michelet, partenaire fid&egrave;le du &laquo; MUR DE LA PAIX &raquo;, sous forme de mini expositions de photographies de l\'action, afin de tenir les habitants au courant de l\'avanc&eacute;e des travaux. Des rencontres jeunes, professeurs, artistes, habitants du quartier y seront organis&eacute;es.</p>]]></pb_project-description>\r\n<pb_project-location>area_3</pb_project-location>\r\n<pb_project-address></pb_project-address>\r\n<pb_project-proposal_url><![CDATA[http://]]></pb_project-proposal_url>\r\n<pb_project-value>35000</pb_project-value>\r\n<pb_project-department></pb_project-department>\r\n<pb_project-image><![CDATA[]]></pb_project-image>\r\n<pb_project-total_votes></pb_project-total_votes>\r\n<pb_project-status>SOUMIS</pb_project-status>\r\n<pb_project-content><![CDATA[]]></pb_project-content>\r\n<pb_project-address_geoloc></pb_project-address_geoloc>\r\n<pb_project-phase1_start_date></pb_project-phase1_start_date>\r\n<pb_project-phase2_start_date></pb_project-phase2_start_date>\r\n<pb_project-phase3_start_date></pb_project-phase3_start_date>\r\n<pb_project-phase4_start_date></pb_project-phase4_start_date>\r\n<pb_project-phase4_end_date></pb_project-phase4_end_date>\r\n<pb_project-campaign>A</pb_project-campaign>\r\n<pb_project-proposal_id></pb_project-proposal_id>\r\n<pb_project-proposal_nicknames></pb_project-proposal_nicknames>\r\n<pb_project-proposal_title></pb_project-proposal_title>\r\n<pb_project-step1_start_date></pb_project-step1_start_date>\r\n<pb_project-step2_start_date></pb_project-step2_start_date>\r\n<pb_project-step3_start_date></pb_project-step3_start_date>\r\n<pb_project-step4_start_date></pb_project-step4_start_date>\r\n<pb_project-step5_start_date></pb_project-step5_start_date>\r\n<pb_project-popular_area>no</pb_project-popular_area>\r\n</pb_project>\r\n', '<pb_project>\r\n<document-id>7</document-id>\r\n<document-title><![CDATA[Wall of Peace]]></document-title>\r\n<document-summary><![CDATA[Wall of Peace]]></document-summary>\r\n<document-date-begin>29/11/2019</document-date-begin>\r\n<document-da