	(3, 176, 1, 'https://sci.esa.int/web/euclid/-/61473-redesign-effort-pays-off-for-euclid-near-infrared-detectors', '', NULL),
	(3, 185, 1, '', '', NULL),
	(4, 110, 1, 'ENVIRONMENT', '', NULL),
