	(4, 118, 1, '', '', NULL),
	(4, 119, 1, 'no', '', NULL),
	(4, 120, 1, '<p>Chaque ann&eacute;e, &agrave; l&rsquo;occasion du vote du budget participatif, les Parisiennes et les Parisiens pl&eacute;biscitent les projets relatifs &agrave; la propret&eacute; et au recyclage t&eacute;moignant ainsi un grand int&eacute;r&ecirc;t pour la qualit&eacute; et le respect de leur espace public et leur attention pour l&rsquo;&eacute;conomie circulaire. Ce projet veut rassembler plusieurs initiatives qui souhaitent poursuivre et renforcer les investissements municipaux dans les &eacute;quipements, le mat&eacute;riel des agents, le mobilier urbain et les dispositifs d&rsquo;information li&eacute;s &agrave; la propret&eacute;.</p>\r\n<p>Il propose de :</p>\r\n<p>- mettre en place davantage de sanitaires (sanisettes, urinoirs, uri-trottoirs&hellip;) et les r&eacute;f&eacute;rencer via une application smartphone ;<br />- renforcer l&rsquo;acquisition de v&eacute;hicules et de mat&eacute;riel innovants, &eacute;cologiques et &agrave; faible impact sonore pour les agents de la propret&eacute; ;<br />- installer du mobilier de propret&eacute; innovant (miroirs contre les urines par exemple) ;<br />- d&eacute;velopper le nombre d&rsquo;&eacute;quipements de tri sur l&rsquo;ensemble du territoire parisien (dans les immeubles et sur l&rsquo;espace public) et de les signaler efficacement pour informer le public ;<br />- mettre en place des dispositifs de type &laquo; nudge &raquo;, tels que des marquages d&rsquo;empreintes de pieds au sol ou des cendriers p&eacute;dagogiques pour amener les usagers &agrave; modifier leur comportement.</p>', '', NULL),
