	(5, 119, 1, 'Popular location', '', NULL),
	(5, 120, 1, '<p>Notre production de d&eacute;chets a doubl&eacute; en quarante ans ! Ces d&eacute;chets co&ucirc;tent cher, et leur impact environnemental est souvent nuisible. Il est paradoxal, de surcro&icirc;t, de jeter autant, alors que certains manquent de tout&hellip; Un autre mod&egrave;le est possible : la r&eacute;cup&eacute;ration, pour donner une nouvelle vie &agrave; ce qui n&rsquo;est pas toujours in&eacute;luctablement un d&eacute;chet ; qu&rsquo;il s&rsquo;agisse d&rsquo;objets ou d&rsquo;alimentation, passons du gaspillage au partage !<br />- avec des ressourceries de quartier, o&ugrave; chacun peut apporter ce qui encombre ses placards, et chiner &agrave; bon prix ce qui est d&eacute;laiss&eacute; par d&rsquo;autres. Ces ressourceries cr&eacute;ent des emplois, du lien social. Elles sont aussi, souvent, corr&eacute;l&eacute;es &agrave; des caf&eacute;s qui r&eacute;cup&egrave;rent des fruits et l&eacute;gumes moches, des denr&eacute;es en date limite de consommation, pour proposer de bons repas accessibles &agrave; tous. Ces lieux d&rsquo;animation permettent aussi d&rsquo;apprendre les gestes du quotidien pour r&eacute;parer et remettre en service ce que d&rsquo;aucuns croient inutilisable, et qui pourtant ne m&eacute;rite pas la poubelle.<br />- avec des solutions applicatives pour mutualiser les objets, ou encore pour favoriser le r&eacute;emploi des mat&eacute;riaux dans la construction et la r&eacute;novation des b&acirc;timents.<br />- avec des bo&icirc;tes &agrave; dons d&rsquo;hyper proximit&eacute;, et des animations micro-locales, pour s&rsquo;&eacute;changer des objets, des denr&eacute;es, cultiver l&rsquo;esprit du don et du partage.</p>', '', NULL),
	(5, 121, 1, '3500000', '', NULL),
	(5, 122, 1, '<img src="https://cdn.paris.fr/paris/2019/09/16/huge-804e5cfb27091437b87aa2aeea02e40c.jpg">', '', NULL),
