	(6, 119, 1, 'no', '', NULL),
	(6, 120, 1, '<p>&nbsp;</p>\r\n<p>Agr&egrave;s pour pratiquer la gymnastique ou la musculation, cr&eacute;ation de terrains de jeux de ballons (Playground, City Stade)... : une autre fa&ccedil;on de vivre le sport en milieu urbain. Le tout sur des sites inhabituels, comme des terrains install&eacute;s sous les lignes de m&eacute;tro a&eacute;riennes ou sur la petite ceinture. A Paris, le sport se pratique aussi en dehors des stades. Le sport urbain gagne en effet chaque ann&eacute;e de nouveaux adeptes. Le projet pr&eacute;voit donc d\'accompagner cette tendance en proposant aux fanas des Street Games - en franglais, "jeux dans la rue" - de nouveaux lieux pour jouer en toute libert&eacute;. Pas de r&eacute;servation, une pratique entre amis, chacun &agrave; son rythme... : c\'est le secret de la r&eacute;ussite du sport urbain !<br />Le projet comprend deux composantes :<br />- D\'une part, l\'installation d\'agr&egrave;s et de parcours sportifs, afin de pratiquer la gymnastique et la musculation. Environ huit sites suppl&eacute;mentaires pourront &ecirc;tre &eacute;quip&eacute;s : esplanades, jardins publics ou certains points de la Petite Ceinture.<br />- D\'autre part, la cr&eacute;ation de terrains de jeux de ballons (Street Basket, foot &agrave; cinq...) sur des lieux insolites : espaces libres sous le m&eacute;tro a&eacute;rien ou sur la Petite Ceinture, r&eacute;utilisation du playground du Pavillon de l\'Arsenal (4e). Environ six lieux pourront ainsi &ecirc;tre &eacute;quip&eacute;s.<br />Cette nouvelle offre renforcera la liste - d&eacute;j&agrave; longue - des sports urbains pratiqu&eacute;s &agrave; Paris : roller, skate, boules, base nautique de la Villette... Sans oublier toutes les activit&eacute;s de Paris Plage et les plaines de jeux des bois de Boulogne et de Vincennes.<br />&nbsp;</p>\r\n<p>&nbsp;</p>', '', NULL),
