	(7, 119, 1, 'no', '', NULL),
	(7, 120, 1, '<p>LE MUR DE LA PAIX est un projet sur le devoir de m&eacute;moire pour se souvenir des personnalit&eacute;s qui ont pr&ocirc;n&eacute; la NON-VIOLENCE et LA PAIX. Il s\'agit d\'embellir le mur de 180m&sup2; de superficie et de d&eacute;corer la cour d\'un coll&egrave;ge class&eacute; ZEP et qui est situ&eacute; dans la Cit&eacute; Michelet ZUS ET ZSP. Les portraits seront ceux de Socrate, Hatchepsout, Lao Tseu, Averoes, Galil&eacute;e, Moli&egrave;re, Olympe de Gouges, Victor Hugo, Jean Jaur&egrave;s, Aim&eacute; C&eacute;saire, Jacques Rabemananjara, Rosa Parks, Martin Luther King, M&egrave;re Th&eacute;resa, Gandhi, Charlie Chaplin, Yehudi Menuhin, Bob Marley, Coluche, Irena Sendlerowa, Nelson Mandela.<br />Des peintres graffiteurs de renom encadreront durant un trimestre &agrave; l\'heure du d&eacute;jeuner les jeunes coll&eacute;giens, pour qu\'ils peignent le portrait de personnalit&eacute;s ic&ocirc;nes du pacifisme et de la non-violence ayant jalonn&eacute; l\'histoire de l\'Humanit&eacute;.<br />Le nom d\'Edmond Michelet sera graffit&eacute; au centre de ce mur, en graffiti v&eacute;g&eacute;tal.<br />Un relais &laquo; information &raquo; mensuel sera organis&eacute; &agrave; la R&eacute;gie de quartier de la Cit&eacute; Michelet, partenaire fid&egrave;le du &laquo; MUR DE LA PAIX &raquo;, sous forme de mini expositions de photographies de l\'action, afin de tenir les habitants au courant de l\'avanc&eacute;e des travaux. Des rencontres jeunes, professeurs, artistes, habitants du quartier y seront organis&eacute;es.</p>', '', NULL),
