	(8, 119, 1, 'no', '', NULL),
	(8, 120, 1, '<p>Le projet de r&eacute;am&eacute;nagement de la place Cambronne, l&rsquo;un des principaux n&oelig;uds de communication du 15e, vise &agrave; offrir plus de confort et de s&eacute;curit&eacute; aux pi&eacute;tons et aux cyclistes, tout en rendant la circulation plus fluide, en r&eacute;novant la chauss&eacute;e, les trottoirs et les plantations de cet espace tr&egrave;s fr&eacute;quent&eacute; et des rues avoisinantes : l&rsquo;avenue de Lowendal, la rue Cambronne, la rue Fr&eacute;micourt et les &laquo; Fermiers G&eacute;n&eacute;raux &raquo; (boulevards de Grenelle et Garibaldi). L&rsquo;ampleur de ce projet n&eacute;cessite de le r&eacute;aliser sur plusieurs ann&eacute;es. En 2015, les habitants en ont fait l&rsquo;un des neuf projets laur&eacute;ats, permettant de r&eacute;aliser les &eacute;tudes de faisabilit&eacute; et de traiter bient&ocirc;t les deux squares et l&rsquo;avenue de Lowendal. Il s&rsquo;agit &agrave; pr&eacute;sent de soutenir la seconde phase des travaux portant sur la partie sud de la place et la jonction avec la rue Fr&eacute;micourt, qui sera r&eacute;nov&eacute;e en 2017, &agrave; l&rsquo;issue des travaux du parc souterrain, ainsi que la r&eacute;novation des trottoirs et des plantations de la rue Cambronne jusqu&rsquo;&agrave; la rue Lecourbe.</p>', '', NULL),
	(8, 121, 1, '720000', '', NULL),
	(8, 122, 1, '<img src="https://cdn.paris.fr/paris/2019/12/04/huge-76057d314c1a117677a88286bb65d67d.jpg">', '', NULL),
	(8, 148, 1, '', '', NULL),
	(8, 149, 1, 'SUIVI', '', NULL),
	(8, 152, 1, '<div style="padding-left: 30px;">\r\n<div style="text-align: justify;">\r\n<p><u style="text-decoration: underline;"><strong>Point sur la r&eacute;alisation du projet en 2019 :</strong></u></p>\r\n<strong>Plus de la moiti&eacute; des r&eacute;alisations ont &eacute;t&eacute; mises en oeuvre</strong>, comme la r&eacute;novation d\'un centre de distribution provisioire des Restaurants du Coeur (14e), l\'achat d\'un v&eacute;hicule de transports pour les personnes sans-abri, ou le projet d\'insertion des ch&ocirc;meurs longue dur&eacute;e.<br /> <br /> Parmi les <strong>innovations sociales</strong>, l\'association Yes We Camp, avec la participation d&rsquo;Aurore, vient d\'ouvrir <u><strong>un restaurant commun</strong></u>, lieu central et vitrine de la deuxi&egrave;me saison des &laquo;&nbsp;Grands Voisins&nbsp;&raquo; (14e). Install&eacute; dans une grande salle de 250m&sup2; avec une cuisine de 130m&sup2; et une terrasse ensoleill&eacute;e donnant sur la cour de l&rsquo;Oratoire de l\'ancien h&ocirc;pital Saint-Vincent de Paul, <strong><u>"L\'Oratoire</u></strong>" est un&nbsp; restaurant inclusif qui propose une alimentation saine et bon march&eacute;, une cuisine locale de saison &agrave; base de produits frais principalement issus d&rsquo;Ile-de-France, et int&eacute;grant une part de valorisation de produits alimentaires invendus r&eacute;cup&eacute;r&eacute;s. Il s&rsquo;agit &eacute;galement d&rsquo;un lieu d&rsquo;apprentissage et d&rsquo;accompagnement vers l&rsquo;emploi, puisque 30 personnes en insertion pourront &ecirc;tre form&eacute;es aux m&eacute;tiers de la cuisine, et des mineurs &eacute;trangers isol&eacute;s pourront acc&eacute;der &agrave; la qualification de &laquo;&nbsp;serveur en restauration&nbsp;&raquo;.<br /> L&rsquo;objectif de ce projet est d&rsquo;exp&eacute;rimenter un concept innovant de restaurant solidaire, dans une perspective de r&eacute;plication, et peut-&ecirc;tre d&rsquo;int&eacute;gration au futur &eacute;co-quartier sur ce site temporairement vacant. <a href="http://lesgrandsvoisins.org/le-projet-2018-2020/bar-et-restaurant/"><span style="color: #0000ff;">Pour en savoir plus.</span></a><br /> <br /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=6579&amp;id_attribute=43&amp;working_content=true/" width="416" height="555" /><br /> <span style="color: #a9a9a9;">La verri&egrave;re illumin&eacute;e du restaurant commun L\'oratoire. &copy; Mairie de Paris</span><br /> <br /> <br /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=6826&amp;id_attribute=43&amp;working_content=true/" /><br /> <br /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=6824&amp;id_attribute=43&amp;working_content=true/" /><br /> <br /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=6825&amp;id_attribute=43&amp;working_content=true/" /><br /> <br /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=6827&amp;id_attribute=43&amp;working_content=true/" /><br /> <br /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=6828&amp;id_attribute=43&amp;working_content=true/" /><br /> <br /> <span style="color: #a9a9a9;"><span style="font-family: calibri,sans-serif; font-size: 11pt; line-height: 115%;">&copy;</span> Arnaud Caillou/L\'Oeil Temoin </span><br /> <br /> <strong><u>Les autres r&eacute;alisations du projet, en cours ou termin&eacute;es :</u></strong><br /> &nbsp;\r\n<p style="margin: 0cm 24.25pt 0pt 0cm; text-indent: 0cm;"><span style="font-size: 11pt;"><span style="font-family: \'Times New Roman\';">&nbsp;</span></span>- <strong>R&eacute;novation des bains-douches Oberkampf (11e)</strong> : le projet vise &agrave; mener des travaux dans les locaux des bains-douches Oberkampf, afin d&rsquo;y cr&eacute;er une structure d&rsquo;accueil de jour pour les personnes sans-abris, de r&eacute;nover et d&rsquo;agrandir la bagagerie existante port&eacute;e par l&rsquo;association les &laquo; Onze Mille potes &raquo; et de mettre l&rsquo;&eacute;tablissement en accessibilit&eacute; tout field4. <strong><span style="background-color: #ffff00;">Les travaux ont &eacute;t&eacute; achev&eacute;s fin 2018 !</span></strong> Le nombre de casiers de la bagagerie a doubl&eacute;, des laves-linges et s&egrave;ches-linges suppl&eacute;mentaires ont &eacute;t&eacute; achet&eacute;s et une entr&eacute;e sp&eacute;cifique permet un acc&egrave;s, y compris lorsque les bains-douches sont ferm&eacute;s. <a href="https://www.paris.fr/actualites/une-bagagerie-pour-les-sans-domicile-fixe-5060"><span style="color: #0000ff;">Lire l\'article Paris.fr sur cette bagagerie</span></a></p>\r\n</div>\r\n<div style="padding-left: 30px;">&nbsp;</div>\r\n</div>\r\n<div style="padding-left: 30px;">- <strong>R&eacute;novation des bains-douches Pyr&eacute;n&eacute;es (20e)</strong> : le projet vise &agrave; am&eacute;liorer la qualit&eacute; de l&rsquo;air par la r&eacute;novation du syst&egrave;me de ventilation, ainsi que la remise en peinture des surfaces murales. Les &eacute;tudes techniques sont actuellement en cours de r&eacute;alisation.</div>\r\n<div style="padding-left: 30px;">&nbsp;</div>\r\n<div style="padding-left: 30px;">- <strong>R&eacute;novation des bains-douches Charenton (12e) : </strong>ce projet r&eacute;pond &agrave; un besoin de financement suppl&eacute;mentaire du <u style="text-decoration: underline;"><u style="color: #0000ff; text-decoration: underline;"><a style="color: #0000ff; text-decoration: underline;" href="https://budgetparticipatif.paris.fr/bp/jsp/site/Portal.jsp?document_id=2070&amp;portlet_id=158">projet localis&eacute; sur le 12&egrave;me arrondissement</a>.</u></u> . Une op&eacute;ration compl&eacute;mentaire de d&eacute;samiantage avant le d&eacute;but des travaux principaux pourrait d&eacute;caler le calendrier de r&eacute;alisation<strong>.</strong>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">- <strong>Implantation de kiosques solidaires</strong> : de nouveaux kiosques solidaires de type "Lulu dans ma rue" ou bien d&rsquo;un.e autre op&eacute;rateur.rice sont pr&eacute;vus courant 2018, notamment dans les 2<sup>e</sup> et 14<sup>e </sup>arrondissements.&nbsp; <span style="background-color: #ffff00;">Une conciergerie solidaire Lulu dans ma rue a &eacute;t&eacute; install&eacute;e &agrave; Plaisance dans le 14e le 25 septembre 2018 !</span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;">- <strong>R&eacute;novation de plusieurs accueils de jour pour sans-abris et acquisition de mat&eacute;riel. Ce projet vise un ensemble de projets de r&eacute;novations actuellement mis en oeuvre au moyen des subventions d&rsquo;investissement aux associations</strong> en charge des Espaces Solidarit&eacute; Insertion (ESI) accueillant des personnes sans domicile fixe. On peut citer :</div>\r\n- l\'acquisition de mat&eacute;riels et mobiliers pour l&rsquo;am&eacute;nagement de l&rsquo;accueil de jour &laquo; Saint-Martin &raquo; labellis&eacute; ESI (mat&eacute;riel de cuisine pour la mise en place d&rsquo;un atelier cuisine, table de ping pong, mobilier, ordinateurs portables pour un atelier informatique)&nbsp;;<br /> - la r&eacute;alisation d&rsquo;op&eacute;rations de r&eacute;am&eacute;nagement de l&rsquo;accueil de jour &laquo; Chez M. Vincent &raquo; (espace hygi&egrave;ne notamment) labellis&eacute; ESI ; <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong></span><br /> <br /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=6560&amp;id_attribute=43&amp;working_content=true/" width="448" height="297" /><br /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=6559&amp;id_attribute=43&amp;working_content=true/" width="447" height="336" /><br /> <span style="color: #808080;">&copy; Axel Massot</span><br /> <br /> - l&rsquo;am&eacute;nagement d&rsquo;un syst&egrave;me permettant d&rsquo;assombrir la salle de caf&eacute;t&eacute;ria pour pr&eacute;server l&rsquo;espace de la chaleur et la r&eacute;alisation d&rsquo;activit&eacute;s n&eacute;cessitant l&rsquo;utilisation d&rsquo;un r&eacute;troprojecteur de l&rsquo;accueil de jour &laquo; La Maison dans la Rue &raquo; labellis&eacute; ESI ;<br /> - l&rsquo;ouverture d&rsquo;un espace num&eacute;rique (photomaton, photocopieuse, imprimante, scan, fax&hellip;.) au sein de l&rsquo;accueil de jour &laquo; Arche d&rsquo;Avenirs &raquo; labellis&eacute; ESI ; <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong></span><br /> - l&rsquo;installation d&rsquo;un cabanon dans le jardin pour l&rsquo;animation d&rsquo;un atelier de jardinage th&eacute;rapeutique &nbsp;&agrave; &nbsp;l&rsquo;accueil de jour &laquo; La Maison dans le Jardin &raquo; labellis&eacute; ESI ;<br /> - l&rsquo;am&eacute;lioration acoustique de l&rsquo;espace caf&eacute;t&eacute;ria de l&rsquo;association &laquo;&nbsp;Mie de Pain&nbsp;&raquo; et l&rsquo;&eacute;quipement des espaces hygi&egrave;ne de l&rsquo;accueil de jour &laquo; Arche d&rsquo;Avenirs &raquo; labellis&eacute; ESI ; <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong></span><br /> - l&rsquo;am&eacute;nagement et l&rsquo;&eacute;quipement de l\'accueil de jour de la Halte Femme de l&rsquo;association &laquo;&nbsp;AURORE&nbsp;&raquo;&nbsp;; <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong></span><br /> - le r&eacute;am&eacute;nagement de l\'accueil de jour de l&rsquo;association &laquo;&nbsp;C&oelig;ur du 5"&nbsp;;<br /> - l&rsquo;acquisition d\'&eacute;quipement informatique pour la domiciliation et l&rsquo;aide &agrave; l\'acc&egrave;s au droit de l&rsquo;association &nbsp;"Solidarit&eacute; Jean Merlin";<br /> - le financement &agrave; la <strong>Fondation de l&rsquo;Arm&eacute;e du Salu</strong>t des travaux au sein du b&acirc;timent L&eacute;on Jouhaux (10&egrave;me), afin d&rsquo;y transf&eacute;rer l&rsquo;activit&eacute; de distribution alimentaire auparavant mise en place dans les locaux de la Caserne Ch&acirc;teau-Landon.</div>\r\n<div style="padding-left: 30px;">&nbsp;<br /> - <strong>R&eacute;novation d\'un centre de distribution provisoire des Restaurants du C&oelig;ur :</strong> Ce projet vise &agrave; la r&eacute;novation de plusieurs centres de distribution de colis alimentaires et de repas chauds&nbsp;:<br /> - le centre de distribution alimentaire situ&eacute; au 7-15 avenue de la Porte de la Villette (19&egrave;me arrondissement).<br /> - le centre d&rsquo;accueil et de distribution alimentaire situ&eacute; 30 rue de Gergovie (14&egrave;me arrondissement). <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute; dans le 14e&nbsp;!</strong></span><br /> <br /> - <strong>&Eacute;quipement du local de l&rsquo;<a href="https://www.toutautrechose.fr/">association Tout Autre Chose</a></strong>, notamment sa cuisine professionnelle, compte tenu du r&ocirc;le transversal de l&rsquo;activit&eacute; de table d&rsquo;h&ocirc;tes au b&eacute;n&eacute;fice de la totalit&eacute; des actions sociales de l&rsquo;association. L&rsquo;association Tout Autre Chose, cr&eacute;&eacute;e en 2007, est ancr&eacute;e dans le tissu local du 9e arrondissement de Paris. Elle a pour objet le d&eacute;veloppement du lien social de proximit&eacute;, l&rsquo;accueil, l&rsquo;&eacute;coute et les &eacute;changes entre toutes les personnes qui franchissent sa porte, qu&rsquo;il s&rsquo;agisse des nombreux b&eacute;n&eacute;voles impliqu&eacute;s, ou des b&eacute;n&eacute;ficiaires de tous horizons sociaux, chacune et chacun pouvant de surcro&icirc;t &ecirc;tre b&eacute;n&eacute;ficiaire et b&eacute;n&eacute;vole &agrave; la fois. Chaque semaine, 500 personnes au moins concourent &agrave; ces &eacute;changes, et le nombre de participations cumul&eacute;es aux activit&eacute;s de l&rsquo;association atteint 12 000 par an. <strong><span style="background-color: #ffff00;">Les locaux r&eacute;nov&eacute;s ont &eacute;t&eacute; inaugur&eacute;s le 7 novembre 2018 !</span></strong><a href="https://www.paris.fr/actualites/tout-autre-chose-et-si-vous-dejeuniez-solidaire-6572"> En savoir plus sur Tout autre chose</a><br /> &nbsp;<br /> - <strong>Installation d&rsquo;une<em> Ideas Box</em></strong> fixe accessible au CHU Jean-Quarr&eacute; (19e) pour permettre un acc&egrave;s dynamique et participatif aux pratiques culturelles et &agrave; l&rsquo;offre des biblioth&egrave;ques. La gestion est assur&eacute;e par Emma&uuml;s, en collaboration avec le r&eacute;seau des biblioth&egrave;ques de la Ville de Paris. <strong><span style="background-color: #ffff00;">Projet r&eacute;alis&eacute;&nbsp;!</span></strong><br /> <br /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=3961&amp;id_attribute=43" alt="Ville de Paris - DDCT/MBP" width="294" height="196" /><img src="https://budgetparticipatif.paris.fr/bp/document?id=3962&amp;id_attribute=43" alt="Ville de Paris - DDCT/MBP" width="294" height="195" /></div>\r\n<div style="padding-left: 30px;"><span style="color: #808080;"><span class="h5">Photos : Le Centre d\'h&eacute;bergement d\'urgence (CHU) install&eacute; dans les anciens locaux du lyc&eacute;e Jean-Quarr&eacute; (19e) o&ugrave; une Ideas Box est mise &agrave; disposition des personnes r&eacute;fugi&eacute;es. &copy; Mairie de Paris</span></span><br /> &nbsp;</div>\r\n<div style="text-align: justify; padding-left: 30px;"><br /> &nbsp;- <strong>Acquisition d\'un v&eacute;hicule &agrave; destination de l&rsquo;unit&eacute; d&rsquo;assistance aux personnes sans-abri</strong>, de transport de neuf places permettant de v&eacute;hiculer des personnes sans-abri, en particulier des familles avec enfants, pour mise &agrave; l\'abri ou transport vers les guichets socio-administratifs et m&eacute;dicaux. <strong><span style="background-color: #ffff00;">Projet r&eacute;alis&eacute;&nbsp;!</span></strong><br /> &nbsp;\r\n<div style="text-align: justify;">- <strong>Achat d\'&eacute;quipements pour les associations en vue du ramassage et de la redistribution d&rsquo;invendus alimentaires</strong> : v&eacute;hicules de collecte, dispositifs de stockage, travaux et am&eacute;nagements de locaux (chambres froides&hellip;).</div>\r\n<div style="text-align: justify;">D&eacute;but novembre 2016, le Conseil de Paris a vot&eacute; 500 000 euros de subvention, attribu&eacute;es &agrave; 19 associations dans le cadre d\'un<u> <a href="http://www.paris.fr/actualites/lutte-contre-le-gaspillage-paris-soutient-19-associations-4230"><span style="color: #000000;">appel &agrave; projets Anti Gaspi.</span></a></u><br /> L\'association <strong><u>Tout autre chose</u> </strong>a ainsi b&eacute;n&eacute;fici&eacute; de l\'installation de sa table d\'h&ocirc;tes dans de nouveaux locaux r&eacute;nov&eacute;s au 40, rue Milton (9e). L\'&eacute;quipe b&eacute;n&eacute;vole propose &agrave; partir de la mi-septembre une activit&eacute; de restauration l&eacute;g&egrave;re au sein de ce lieu d\'accueil, d\'&eacute;changes et d\'&eacute;coute, ancr&eacute; dans le quartier. <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute; !</strong></span></div>\r\n<div style="text-align: justify;">&nbsp;</div>\r\n<div style="text-align: justify;"><strong>&nbsp;<img src="https://budgetparticipatif.paris.fr/bp/document?id=3298&amp;id_attribute=43" alt="Ville de Paris DASES" width="373" height="270" /></strong></div>\r\n<div style="text-align: justify;"><span style="color: #808080;">&nbsp;Photo : La nouvelle camionnette de la Banque alimentaire de Paris et d\'&Iuml;le de France.</span></div>\r\n<div style="text-align: justify;"><br /> <br /> <br /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=6829&amp;id_attribute=43&amp;working_content=true/" /><br /> <span style="color: #a9a9a9;">Photo : v&eacute;hicule du Secours populaire</span> <span style="color: #a9a9a9;">- &copy;Arnaud Caillou/L\'Oeil Temoin</span><br /> <br /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=6830&amp;id_attribute=43&amp;working_content=true/" /><br /> <br /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=6831&amp;id_attribute=43&amp;working_content=true/" /><br /> <br /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=6832&amp;id_attribute=43&amp;working_content=true/" /><br /> <span style="color: #a9a9a9;">Photo : v&eacute;hicule du Cha&icirc;non Manquant - &copy;Arnaud Caillou/L\'Oeil Temoin </span><br /> <br /> -<strong> D&eacute;veloppement de l&rsquo;exp&eacute;rimentation territoriale "Z&eacute;ro ch&ocirc;meur longue dur&eacute;e"&nbsp;: </strong>l&rsquo;Entreprise &agrave; But Emploi, &laquo; 13 Avenir &raquo;, association loi 1901 cr&eacute;&eacute;e pour mettre en &oelig;uvre l&rsquo;exp&eacute;rimentation, a pour mission de recruter toutes les personnes volontaires, en recherche d&rsquo;emploi depuis plus d&rsquo;un an, r&eacute;sidant dans les quartiers, Oudin&eacute;-Chevaleret et B&eacute;dier-Boutroux. Elle le fait progressivement en d&eacute;veloppant des activit&eacute;s nouvelles, utiles aux usagers du territoire, car r&eacute;pondant &agrave; des besoins jusqu&rsquo;ici non-couverts. D&eacute;but 2018, elle compte une &eacute;quipe de 17 personnes, d&eacute;ploy&eacute;e sur diff&eacute;rentes activit&eacute;s&nbsp;: v&eacute;g&eacute;talisation d&rsquo;espaces partag&eacute;s, services de conciergerie d&rsquo;entreprise, services de conciergerie de quartier en direction des s&eacute;niors, production de mobilier d&rsquo;ext&eacute;rieur en bois de r&eacute;cup&eacute;ration. La structure va grossir progressivement dans les 5 ann&eacute;es de l&rsquo;exp&eacute;rimentation.<br /> &nbsp;</div>\r\n&nbsp;- <strong>Projet "ENVIE"&nbsp;</strong>: port&eacute; par la F&eacute;d&eacute;ration d&rsquo;Entreprises d&rsquo;Insertion (ENVIE), ce projet pr&eacute;voit l&rsquo;<strong>installation d&rsquo;un commerce solidaire de vente d&rsquo;appareils &eacute;lectrom&eacute;nagers d&rsquo;occasion</strong> au 10 rue Julien Lacroix, dans le 20e arrondissement, qui emploiera des salari&eacute;s en insertion. <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong> </span><br /> <br /> <br /> &nbsp;- <strong>&Eacute;quipement des points Paris Emploi :</strong>\r\n<ul>\r\n<li>MIE Bastille, 50 rue des Tournelles (3<sup>e</sup>) : <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong></span></li>\r\n<li>MIE Labo 6, 76bis rue de Rennes (6<sup>e</sup>) <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong></span></li>\r\n<li>Point Paris Emploi 20e,&nbsp;31 rue Pix&eacute;r&eacute;court : <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong></span></li>\r\n<li>Point Paris Emploi 13e, 18 rue Auguste Perret : <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong></span></li>\r\n<li>Point Paris Emploi 10e, 209 rue La Fayette : <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong></span></li>\r\n<li>Point Paris Emploi 18e, 164 rue Ordener : <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong></span></li>\r\n<li>Point Paris Emploi 15e, 14 rue Armand Moissant :&nbsp;<span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong></span></li>\r\n<li>Point Paris Emploi 14e, 12 rue Pierre Castagnou :&nbsp;<span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong></span></li>\r\n</ul>\r\n<br /> <br /> &nbsp;<br /> &nbsp;<br /> <span style="background-color: #ffffff;">- </span><strong>&Eacute;quipement de l\'Atelier Chantier Insertion du Centre d&rsquo;Action Sociale de la Ville de Paris (CASVP)</strong> pour r&eacute;aliser des prestations de nettoyage &eacute;cologique sur cinq centres d\'h&eacute;bergement.</div>\r\n<div style="text-align: justify; padding-left: 30px;"><span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong></span><br /> <br /> - <strong>Mieux adapter l\'offre de prise en charge des familles en fin de parcours d\'insertion.</strong> Au Centre d\'h&eacute;bergement d\'Urgence (CHU) rue de Crim&eacute;e dans le 19&egrave;me arrondissement, le projet a permis la suppression de la restauration collective, remplac&eacute;e par des kitchenettes individuelles dans cinq appartements tremplins, pour permettre aux familles de cuisiner et de prendre leurs repas avec leurs enfants. <span style="background-color: #ffff00;"><strong>Projet r&eacute;alis&eacute;&nbsp;!</strong> </span><br /> &nbsp;\r\n<div style="text-align: justify;"><em><strong><img src="https://budgetparticipatif.paris.fr/bp/document?id=6549&amp;id_attribute=43&amp;working_content=true/" width="505" height="337" /> <img src="https://budgetparticipatif.paris.fr/bp/document?id=6548&amp;id_attribute=43&amp;working_content=true/" width="510" height="337" /> </strong></em>\r\n<div style="text-align: justify;"><span style="color: #808080;">Photos :&nbsp; Le nouvel espace partag&eacute; du CHU Crim&eacute;e (19e), cr&eacute;&eacute;e en remplacement de la restauration collective et &eacute;quip&eacute; de cuisines individuelles. &copy; Axel Massot</span></div>\r\n<div style="text-align: justify;">\r\n<div style="text-align: justify;"><em><strong><em><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></em></strong></em></div>\r\n<strong>- <strong>S&eacute;curisation des parcours d\'insertion vers le logement des populations jeunes.</strong></strong><br /> Le budget participatif a permis la reconstruction de l\'ancien Centre d&rsquo;h&eacute;bergement d&rsquo;Urgence George Sand dans le 20&egrave;me arrondissement et la r&eacute;novation des services du P&ocirc;le Jeunes qui accueille de jeunes sans domicile fixe de 18 &agrave; 27 ans.<br /> <strong>Ce projet a notamment contribu&eacute; &agrave; l&rsquo;ameublement de ces appartements tremplins.<span style="background-color: #ffff00;"><strong> Projet r&eacute;alis&eacute;&nbsp;!</strong></span><br /> - <strong>Achat de mobilier pour &eacute;quiper quatre appartements lou&eacute;s en diffus</strong>. <strong><span style="background-color: #ffff00;">Projet r&eacute;alis&eacute;&nbsp;!</span></strong></strong><br /> <br /> <strong>- <strong>Projet de partage de cinq grands appartements afin d&rsquo;&eacute;viter les nuits d\'h&ocirc;tel.</strong></strong><br /> &nbsp;Cr&eacute;ation de 30 places d\'h&eacute;bergement en diffus. Le Budget Participatif a permis de meubler dix appartements sur les onze pr&eacute;vus.<br /> <strong><strong>Projet en cours de r&eacute;alisation.</strong></strong><br /> <br /> <strong>- Cr&eacute;ation d\'un logiciel facilitant la gestion nominative des autorisations et de r&eacute;siliations de domiciliation administrative, de l\'arriv&eacute;e et de retrait de courriers, d&eacute;ploy&eacute; dans trois permanences sociales d\'accueil.<span style="background-color: #ffff00;"><strong> Projet r&eacute;alis&eacute;&nbsp;!</strong></span><br /> <br /> <strong>- Am&eacute;nagement de Points Paris Emploi</strong></strong> dans le 13&egrave;me arrondissement par la Mission Locale de Paris et dans les 10&egrave;me et 18&egrave;me arrondissements par l\'Ensemble Paris Emploi Comp&eacute;tences qui accueillent et orientent les demandeurs d\'emploi. <strong>Projet en cours de r&eacute;alisation.</strong></div>\r\n<div style="text-align: justify;"><em><strong>&nbsp;</strong></em></div>\r\n</div>\r\n</div>', '', NULL),
