INSERT INTO htmlpage (id_htmlpage, description, html_content, status, workgroup_key, role) VALUES
	(1, 'Main Logo', '<p><img src="images/logo-openpb-1280x1024.png" width="50%" /></p>', 0, 'all', 'none'),
	(5, 'Mentions légales', '<div class="container">\r\n<div class="row">\r\n<div class="col-xs-12 col-sm-12 col-md-8 col-md-offset-2">\r\n<div class="bg-bleu-clair">\r\n<div class="portlet">\r\n<div class="portlet-content pad">\r\n<h1 class="title1">Mentions l&eacute;gales</h1>\r\n<p>Le pr&eacute;sent site (le &laquo; Site &raquo;) est g&eacute;r&eacute; par La Direction des&nbsp;Syst&egrave;mes d\'Information&nbsp;et du Num&eacute;rique&nbsp;(DSIN) et le d&eacute;partement Paris num&eacute;rique de la Direction de l&rsquo;information et de la communication (DICOM). L&rsquo;animation &eacute;ditoriale et les mises &agrave; jour du site sont assur&eacute;es par l&rsquo;ensemble des directions de la Ville sous le pilotage de la DICOM. Le webdesign a &eacute;t&eacute; con&ccedil;u par la Direction de la Communication de la Mairie de Paris avec le concours de <a href="http://www.atlantiquestudio.com/" target="_blank">Thibault Caizergues</a> et d&eacute;velopp&eacute; par la DSIN. La maintenance technique et l&rsquo;h&eacute;bergement sont assur&eacute;s par la DSIN.</p>\r\n<p>Pour toute suggestion, information, r&eacute;action concernant exclusivement ce site, n&rsquo;h&eacute;sitez pas &agrave; &eacute;crire &agrave; la r&eacute;daction de Paris Num&eacute;rique :</p>\r\n<p>DICOM, Mairie de Paris,<br /> Paris Num&eacute;rique,<br /> 4, rue de Lobau,<br /> 75196 PARIS CEDEX 04 &ndash; France</p>\r\n<p>Ou par mail <a href="contact.html">ici</a>.</p>\r\n<h2 class="sub-title">CHARTE D\'UTILISATION DU SITE</h2>\r\n<p>Consultez la charte d\'utilisation du site Budget Participatif en cliquant <a href="document?id=2237&amp;id_attribute=102" target="_blank">ici</a>.</p>\r\n<h2 class="sub-title">DROITS D&rsquo;AUTEUR ET REPRISE DU CONTENU</h2>\r\n<p>Tous les contenus pr&eacute;sents sur le Site sont couverts par le droit d&rsquo;auteur. Toute reprise est d&egrave;s lors conditionn&eacute;e &agrave; l&rsquo;accord de l&rsquo;auteur en vertu de l&rsquo;article L.122-4 du Code de la Propri&eacute;t&eacute; Intellectuelle (1). Cette affirmation souffre n&eacute;anmoins d&rsquo;une exception pos&eacute;e par l&rsquo;article L.122-5 du Code de Propri&eacute;t&eacute; intellectuelle (2).</p>\r\n<h2 class="sub-title">LES DIFF&Eacute;RENTS CONTENUS PR&Eacute;SENTS SUR LE SITE</h2>\r\n<p>Ecrits et/ou mis en ligne par la r&eacute;daction du site, ces contenus ne sauraient &ecirc;tre reproduits librement sans l&rsquo;indication de la source.</p>\r\n<p>De m&ecirc;me, la technique de lien profond (&laquo; deep linking &raquo;) est proscrite, c&rsquo;est &agrave; dire que les pages du Site ne doivent pas &ecirc;tre imbriqu&eacute;es &agrave; l&rsquo;int&eacute;rieur des pages d&rsquo;un autre site. Seule est donc autoris&eacute;e, la reproduction d&rsquo;un contenu, assortie de :</p>\r\n<ul>\r\n<li>l&rsquo;ajout de la mention &raquo; Article paru sur le site budgetparticipatif.paris.fr &laquo; . Cette mention pointera gr&acirc;ce &agrave; un lien hyper-texte directement sur le contenu.</li>\r\n<li>l&rsquo;ajout en bas de chaque contenu de la mention &laquo; Droits r&eacute;serv&eacute;s &raquo;. En outre, les informations utilis&eacute;es ne doivent l&rsquo;&ecirc;tre qu&rsquo;&agrave; des fins personnelles, associatives ou professionnelles, toute diffusion ou utilisation &agrave; des fins commerciales ou publicitaires &eacute;tant exclues.</li>\r\n</ul>\r\n<h2 class="sub-title">L&rsquo;EXCEPTION DES DISCOURS DES &Eacute;LUS</h2>\r\n<p>L&rsquo;article L.122-5 du Code de la Propri&eacute;t&eacute; intellectuelle pose le principe selon lequel, &laquo; lorsque l&rsquo;&oelig;uvre a &eacute;t&eacute; divulgu&eacute;e, l&rsquo;auteur ne peut interdire la diffusion, m&ecirc;me int&eacute;grale, par la voie de presse ou de t&eacute;l&eacute;diffusion, &agrave; titre d&rsquo;information d&rsquo;actualit&eacute;, des discours destin&eacute;s au public prononc&eacute;s dans les assembl&eacute;es politiques, (&hellip;), ainsi que dans les r&eacute;unions publiques d&rsquo;ordre politique et les c&eacute;r&eacute;monies officielles &raquo;. Ainsi, les discours des &eacute;lus s&rsquo;apparentent &agrave; une exception au droit d&rsquo;auteur. La reprise de ces discours de fa&ccedil;on partielle ou int&eacute;grale est ainsi autoris&eacute;e, sous r&eacute;serve bien entendu de la mention du nom de l&rsquo;auteur et de la source.</p>\r\n<p>La mention &laquo; site Internet de la Ville de Paris &raquo; devra donc &ecirc;tre indiqu&eacute;e.</p>\r\n<h2 class="sub-title">DONN&Eacute;ES PERSONNELLES</h2>\r\n<p>Consultez <a href="http://www.paris.fr/infos_editeur/infos-editeur/paris-connect/rub_5005_stand_108377_port_10757" target="_blank">les termes des engagements de la Ville de Paris</a> concernant le traitement des donn&eacute;es personnelles. Ils ont pour but de vous informer sur la mani&egrave;re dont sont utilis&eacute;es ces donn&eacute;es et vous indique la fa&ccedil;on de proc&eacute;der si vous souhaitez y apporter une modification.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 0, 'all', 'none');
